B.GO=new A.aV(B.rz,["HapTID","Haptic Technology for Improved Dexterity","GitHub","https://github.com/louis-badr/HapTID","Haptic technologies are increasingly used in rehabilitation settings. Stroke victims suffer from severe motor and sensory deficits that handicap their daily lives. HapTID's first purpose is to study and improve dexterity in healthy subjects. It will then be used as a toolkit by researchers and medical professionals to extend the study to post-stroke neuro-rehabilitation. I was able to carry out the literature review, design and fabrication of the system and a study at the Integrative Neuroscience & Cognition Center under the supervision of Lucile Dupin and in collaboration with the Paris Institute of Psychiatry and Neuroscience."],t.l)
B.Hm={title:0,subtitle:1,asset:2,description:3}
B.Gp=new A.aV(B.Hm,["AugmenTip","Fingertip haptic feedback on a budget","images/thimble-quarter.png"," Hands are our main means of physical interaction with our environment, hence the desire to reproduce these sensations artificially and to do without traditional peripherals such as controllers for virtual experiences. In recent years, a number of DIY and open-source projects have emerged that have made haptics more attractive and accessible. One of the best-known projects is LucidGloves, an exoskeleton for the hand that provides kinaesthetic grasping sensations. AugmenTip aims to add cutaneous feedback (contact, pressure and vibration) to all five fingertips within the same DIY and open source framework. This project was carried out at DeVinci Innovation as part of the Creative Technology Engineering master's program."],t.l)
