B.GT=new A.aV(B.rx,["DVIC Signet Ring","Making a graduation ring from scratch for the DVIC students","To celebrate the graduation of the Creative Technology program, I was given the challenge of creating a signet ring to give to the students, reflecting their projects and their pride in belonging to this community. For the first edition, I designed the ring and introduced a manufacturing process based on resin-wax 3D printing and vacuum metal casting to create aesthetic and durable silver rings. The design evokes the themes of the three DVIC groups and projects: technology, nature and humans."],t.l)
